import React from 'react';
import Card from './IU/Card';
import UserInfo from './components/UserInfo/UserInfo';
import style from './App.module.css';


function App() {
  return (
    <div className={style.container}>
      <h2>Hola mundo !!</h2>
      <UserInfo />
      <Card>
        <h3>Hola mundo !!</h3>
      </Card>
    </div>
  );
}

export default App;
